import React from "react";

import "./index.scss";
export const FieldTitle = ({ icon, label }) => {
  return (
    <div className="field-title">
      <object className="field-icon" data={icon} type="image/svg+xml">
        <img alt="descriptor" src={icon} />
      </object>
      <label>{label}</label>
    </div>
  );
};
